import React,{Component} from 'react';
import Card from './card';
import img1 from '../images/ed.png'


class Cards extends Component{
    render(){
        return(
    <div className="row">
        <div className="col-md-4">
        <Card imgsrc={img1} title="Jeu d'échec" popup="jrkfnjk" popupDesc="Yessine aussi" link="./service1" />
        
        </div>
        <div className="col-md-4">
<Card imgsrc={img1} title="Pyramides"  popup="fjekk" popupDesc="test" link="./service2"/>
        </div>
        <div className="col-md-4">
<Card imgsrc={img1} title="Test"  popup="Remi le bg²" popupDesc="/" link=""/>
        </div>
    </div>

        );
    }
}
export default Cards;
